import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';



class App extends React.Component {
    state = {
        todo: 'newTodo',
        filter: 'all'
    }

    render() {
        return (
            <div>{this.state.todo}</div>
        )
    }
}


